  render() {
    return (
      <div className="card" style={{ margin: "10px" }}>
        <div className="card-body">
          <h5 className="card-title">About us</h5>
          <p className="card-text">Do you really want to know about us? </p>
        </div>
      </div>
    );
  }
}
export default AboutView;
